import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Head = () => {
    return (
        <View style={styles.home_heading}>
            <Text style={styles.serviceStyle}>Services</Text>
            <Text style={styles.btnStyle}>Show All</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    home_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        margin: '10px',
    },
    serviceStyle: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
})

export default Head;
